import { useState } from "react";

function DonationsSample() {
  const [donations] = useState([
    { id: 1, date: "2025-08-15", donor: "Juan Dela Cruz", bloodGroup: "A+", volume: 500 },
    { id: 2, date: "2025-08-18", donor: "Maria Santos", bloodGroup: "O-", volume: 450 },
    { id: 3, date: "2025-08-20", donor: "Carlos Reyes", bloodGroup: "B+", volume: 600 },
    { id: 4, date: "2025-08-21", donor: "Angela Cruz", bloodGroup: "AB-", volume: 400 },
    { id: 5, date: "2025-08-22", donor: "Jose Ramirez", bloodGroup: "O+", volume: 550 },
    { id: 6, date: "2025-08-23", donor: "Sofia Mendoza", bloodGroup: "A-", volume: 480 },
    { id: 7, date: "2025-08-24", donor: "Miguel Torres", bloodGroup: "B-", volume: 500 },
    { id: 8, date: "2025-08-25", donor: "Isabella Cruz", bloodGroup: "AB+", volume: 470 },
    { id: 9, date: "2025-08-26", donor: "Daniel Garcia", bloodGroup: "O-", volume: 520 },
    { id: 10, date: "2025-08-27", donor: "Camille Santos", bloodGroup: "A+", volume: 490 },
    { id: 11, date: "2025-08-28", donor: "Luis Fernandez", bloodGroup: "B+", volume: 510 },
    { id: 12, date: "2025-08-29", donor: "Andrea Ramos", bloodGroup: "O+", volume: 600 },
    { id: 13, date: "2025-08-30", donor: "Patrick Dizon", bloodGroup: "A-", volume: 450 },
    { id: 14, date: "2025-08-31", donor: "Katrina Lopez", bloodGroup: "AB-", volume: 400 },
    { id: 15, date: "2025-09-01", donor: "Marco Perez", bloodGroup: "O+", volume: 560 },
    { id: 16, date: "2025-09-02", donor: "Nicole Gutierrez", bloodGroup: "B+", volume: 500 },
    { id: 17, date: "2025-09-03", donor: "Rafael Cruz", bloodGroup: "O-", volume: 480 },
    { id: 18, date: "2025-09-04", donor: "Hannah Villanueva", bloodGroup: "A+", volume: 530 },
    { id: 19, date: "2025-09-05", donor: "Joshua Santos", bloodGroup: "B-", volume: 490 },
    { id: 20, date: "2025-09-06", donor: "Monica Delgado", bloodGroup: "AB+", volume: 550 },
  ]);

  const [search, setSearch] = useState("");
  const [currentPage, setCurrentPage] = useState(1);
  const [itemsPerPage, setItemsPerPage] = useState(5);

  const filteredDonations = donations.filter(
    (d) =>
      d.donor.toLowerCase().includes(search.toLowerCase()) ||
      d.bloodGroup.toLowerCase().includes(search.toLowerCase()) ||
      d.date.includes(search)
  );

  const totalPages = Math.ceil(filteredDonations.length / itemsPerPage);
  const startIndex = (currentPage - 1) * itemsPerPage;
  const currentDonations = filteredDonations.slice(startIndex, startIndex + itemsPerPage);

  return (
    <div className="p-6">
      <h2 className="text-2xl font-bold text-[#800000] mb-4">Sample Donations</h2>

      {/* Controls */}
      <div className="flex flex-col md:flex-row md:items-center md:justify-between gap-4 mb-4">
        {/* Search Bar */}
        <input
          type="text"
          placeholder="Search by donor, blood group, or date..."
          value={search}
          onChange={(e) => setSearch(e.target.value)}
          className="p-2 border rounded w-full md:w-1/2"
        />

        {/* Rows per page */}
        <div className="flex items-center gap-2">
          <label htmlFor="rows" className="text-sm font-medium">Rows per page:</label>
          <select
            id="rows"
            value={itemsPerPage}
            onChange={(e) => {
              setItemsPerPage(Number(e.target.value));
              setCurrentPage(1);
            }}
            className="p-2 border rounded"
          >
            <option value={5}>5</option>
            <option value={10}>10</option>
            <option value={20}>20</option>
          </select>
        </div>
      </div>

      <table className="w-full border border-gray-300 rounded-lg overflow-hidden">
        <thead className="bg-[#800000] text-white">
          <tr>
            <th className="p-2">#</th>
            <th className="p-2">Date</th>
            <th className="p-2">Donor</th>
            <th className="p-2">Blood Group</th>
            <th className="p-2">Volume (ml)</th>
          </tr>
        </thead>
        <tbody>
          {currentDonations.map((d, index) => (
            <tr key={d.id} className="border-b hover:bg-gray-100">
              <td className="p-2 text-center">{startIndex + index + 1}</td>
              <td className="p-2">{d.date}</td>
              <td className="p-2">{d.donor}</td>
              <td className="p-2">{d.bloodGroup}</td>
              <td className="p-2 text-center">{d.volume}</td>
            </tr>
          ))}
        </tbody>
      </table>

      {/* Pagination */}
      <div className="flex justify-center items-center gap-2 mt-4">
        <button
          onClick={() => setCurrentPage((prev) => Math.max(prev - 1, 1))}
          disabled={currentPage === 1}
          className="px-3 py-1 bg-[#800000] text-white rounded disabled:opacity-50"
        >
          Prev
        </button>
        <span>
          Page {currentPage} of {totalPages}
        </span>
        <button
          onClick={() => setCurrentPage((prev) => Math.min(prev + 1, totalPages))}
          disabled={currentPage === totalPages}
          className="px-3 py-1 bg-[#800000] text-white rounded disabled:opacity-50"
        >
          Next
        </button>
      </div>
    </div>
  );
}

export default DonationsSample;
